de:
Décision no 3/2005 - nouveau Protocole E: entraide administrative en matière de douane (appendice 2), selon art 34 un nouveau paragraphe 3 est inséré dans l'art. 3 de l'Accord (message du 11.01.2006, FF 2006, 1735/1767, AF du 15.03.2006, RO 2008, 3759/3759);

11.04.2006: acceptation CH au dépositaire (Norvège); 29.08.2006: acceptation Israël; 
02.05.2007: acceptation Norvège; 
04.06.2007: acceptation Liechtenstein
11.07.2008: acceptation Islande; - 15-06-2005 - Abkommen vom 17. September 1992 zwischen den EFTA-Staaten und Israel (mit Verständigungsprotokoll, Erkl. und Anhängen)

